import React, { useState, useEffect } from "react";
import APIStored from "../components/API/APIStored";
import axios from "axios";

function TestingAPI() {
  const [data, setData] = useState([]);
  const [accData, setAccountData] = useState([]);

  useEffect(() => {
    APIStored()
      .then((response) => {
        console.log(JSON.stringify(response.data)); // Check the entire response object
        setData(response.data);
      })
      .catch((error) => console.error("Error", error));
  }, []);

  console.log(JSON.stringify([...data]));
  const userAPIRes = data;
  let MapFunUser = userAPIRes.map((items) => parseInt(items.id));

  data.map((item) => console.log(item.id));
  const accApi = axios.get("http://localhost:8080/api/account");
  useEffect(() => {
    accApi
      .then((response) => {
        console.log(JSON.stringify(response.data)); // Check the entire response object
        setAccountData(response.data);
      })
      .catch((error) => console.error("Error", error));
  }, []);

  console.log(JSON.stringify([...accData]));
  const accApiData = data;
  let MapFunAcc = accApiData.map((items) => parseInt(items.id));
  console.log(MapFunAcc);

  data.map((item) => console.log(item.id));

  console.log(parseInt(MapFunAcc), parseInt(MapFunUser));

  if (parseInt(MapFunAcc) === parseInt(MapFunUser)) {
  } else {
    console.log("BUMMER");
  }
  console.log(JSON.stringify(data));
  console.log(parseInt(MapFunAcc));

  const intAPI = axios.get(
    `http://localhost:8080/api/account/${parseInt(MapFunUser)}`
  );

  useEffect(() => {
    intAPI
      .then((response) => {
        console.log(JSON.stringify(response.data)); // Check the entire response object
        setAccountData(response.data);
      })
      .catch((error) => console.error("Error", error));
  }, []);
  return (
    <div>
      <table border="1">
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Password</th>
            <th>Mobile</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.first_Name}</td>
              <td>{item.last_Name}</td>
              <td>{item.email}</td>
              <td>{item.password}</td>
              <td>{item.mobile}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default TestingAPI;

